import React from 'react';
import {Container} from "react-bootstrap";

const Contact = () => {
    return (
        <Container>
            <div>
                <h1>Хотите съемку?</h1>
                <h2 style={{width: 330, fontSize: 20, fontWeight: 300}}>Оставьте заявку и я свяжусь с вами в ближайщее время?</h2>
            </div>


        </Container>

    );
};

export default Contact;
